import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();

        // Initial setup
        set.add(5);
        set.add(10);

        // Intermediate computations
        int computation = (int)Math.pow(2, 3) + 5 - 10;
        boolean misleadingCondition = computation < 0;

        // Other operations not affecting the read value
        set.add(15);
        set.remove(10);
        set.add(20);

        // Write point with conditional logic
        if (misleadingCondition) {
            set.add(25);
        } else {
            /* write */ set.add(30);
        }

        // More operations
        set.add(35);
        set.add(computation);

        // Complex manipulation outside influence of read value
        int sum = 0;
        for (Integer num : set) {
            sum += num;
        }
        set.add(sum);

        // Final check before read
        int check = sum % 2;
        if (check == 1) {
            set.add(40);
        }

        // Read point
        /* read */ int ret = (set.contains(30)) ? 30 : 0;
        System.out.println("Retrieved value: " + ret);
    }
}
